import React from "react";
import Data from "../data.json";

function Card() {
  console.log(Data);
  return (
    <div>
      Hellow world
      {Data.map((item, key) => {
        return (
          <div key={key}>
            <img src={item.icon} alt={item.category} />
          </div>
        );
      })}
    </div>
  );
}

export default Card;
